(9345, 5642, 0, 1, '不藥而癒', '詞:GT天才薇\r\n曲:BS阿帆\r\n鼓:DR扯蛋業\r\n唱:VOC小秘\r\n', '0000-00-00 00:00:00', 0000, 0, 2, 4, '帶著虛偽的面具\r\n說著自己也不懂的話語\r\n究竟上演的是生命\r\n還是別人漠視的空氣\r\n\r\n淋濕全身的大雨\r\n想著你和他快樂的神情\r\n究竟勝利的是自己\r\n還是別人譏笑的序曲\r\n\r\n熱舞 替代不了呼吸\r\n擁抱 填滿不了空虛\r\n激情 解決不了愛情\r\n誓言 逃離不了玩膩\r\n\r\n能不能多一點建議\r\n如何扮演好這場戲\r\n萬物的牽連是關係\r\n每句台詞都有他的道理\r\n\r\n能不能少一些爭議\r\n我就是遊戲的法律\r\n隱藏的角色是個謎\r\n離開或留下讓自己決定\r\n\r\n', '', 256, '', 'Finy', 'Finy', '雪影', '雪影', '', 0, 1, 0, '2008-11-06 23:45:08', '2015-03-12 13:35:07', '0000-00-00 00:00:00'),
