(9365, 1, 1078, 2, '自由之處', '', '2008-11-07 00:00:00', 0000, 30, 2, 7, '簇擁著降臨的自由\r\n那喧譁的雲朵\r\n裝扮天空中最孩子氣的笑臉\r\n\r\n依偎著寧靜的宇宙\r\n那璀麗的絲綢\r\n閃爍星空中那勝利般的焰火\r\n\r\n音階中急促流洩快速飛躍的欣喜畫面\r\n這是美麗的世界\r\n請你填補我那心中預備的空缺\r\n\r\n波送著湛藍的希望\r\n那慈祥的海洋\r\n懷抱地平線最多面性的試驗\r\n\r\n擺盪著雀躍的步伐\r\n那都市的群像\r\n妝點街頭中那盛開般的熱烈\r\n\r\n音階中急促流洩快速飛躍的欣喜畫面\r\n這是美麗的世界\r\n請你填補我的空缺\r\n\r\n當曙光照亮了黑暗\r\n讓自由輕拂我的臉\r\n當信仰消融了遺憾\r\n讓希望喚醒這世界\r\n\r\nGo get what you want\r\nGo get what you want and ache for more\r\nGo get what you want\r\nwhat you want', '', 291, '', '吳新逸/吳柏蒼', '吳柏蒼', '吳柏蒼', '回聲樂團', '', 1, 0, 0, '2008-08-26 00:08:46', '2015-03-12 13:35:08', '0000-00-00 00:00:00'),
